using Newtonsoft.Json;
using System;
using System.Collections;
using System.Collections.Generic;
using System.Text;
using UnityEngine;
using UnityEngine.Networking;

namespace Assets.Scripts.TTS
{
    public class GoogleTTS: MonoBehaviour, ITTS
    {
        public static GoogleTTS Instance;

        private void OnEnable()
        {
            if (Instance == null) Instance = this; else Destroy(this);
        }

        private void Destroy(GoogleTTS googleTTS)
        {
            throw new NotImplementedException();
        }

        public void SpeakStartCoroutine(string text)
        {
            StartCoroutine(Upload(text));// "");
        }

        IEnumerator Upload(string text)
        {

            string apiURL = @"https://texttospeech.googleapis.com/v1/text:synthesize";

            Dictionary<string, object> formData = new()
        {
            { "input", new Dictionary<string, string> { { "text", text } } },
            { "voice", new Dictionary<string, string> { { "languageCode", "en-gb" }, { "name", "en-GB-Standard-A" }, { "ssmlGender", "FEMALE" } } },
            { "audioConfig", new Dictionary<string, string> { { "audioEncoding", "LINEAR16" } } },
        };

            print(apiURL);

            string jsonData = JsonConvert.SerializeObject(formData);
            print(jsonData);

            using UnityWebRequest webRequest = UnityWebRequest.Post(apiURL, string.Empty);

            webRequest.SetRequestHeader("X-goog-api-key", "AIzaSyCoFedaOi88L3ZsnFLAvyAetv3hYrsNM60");

            webRequest.uploadHandler = new UploadHandlerRaw(Encoding.UTF8.GetBytes(jsonData));

            yield return webRequest.SendWebRequest();

            string[] pages = apiURL.Split('/');
            int page = pages.Length - 1;

            print(webRequest.result);
            switch (webRequest.result)
            {
                case UnityWebRequest.Result.ConnectionError:
                    print("Connection error.");
                    break;
                case UnityWebRequest.Result.DataProcessingError:
                    Debug.LogError(pages[page] + ": Error: " + webRequest.error);
                    break;
                case UnityWebRequest.Result.ProtocolError:
                    Debug.LogError(pages[page] + ": HTTP Error: " + webRequest.error);
                    break;
                case UnityWebRequest.Result.Success:
                    print(webRequest.downloadHandler.text);
                    GoogleTTSJsonClass data = JsonConvert.DeserializeObject<GoogleTTSJsonClass>(webRequest.downloadHandler.text);
                    LipSync.Instance.activateBase64Sound(data.audioContent);
                    break;
            }
        }

        public void Speak(string text)
        {
            SpeechSynthesizer.Instance.source.Stop();
            if (!SpeechSynthesizer.Instance.source.isPlaying)
                Instance.SpeakStartCoroutine(text);
        }
    }
}

public class GoogleTTSJsonClass
{
    public string audioContent { get; set; }
}